export function similarity(e,t){let l=0;if(0===e.length||0===t.length)return 0;if(e===t)return 1;let r=Math.floor(Math.max(e.length,t.length)/2)-1,n=new Array(e.length),h=new Array(t.length);for(let f=0;f<e.length;f++){let g=f>=r?f-r:0,i=f+r<=t.length?f+r:t.length-1;for(let r=g;r<=i;r++)if(!0!==n[f]&&!0!==h[r]&&e[f]===t[r]){++l,n[f]=h[r]=!0;break}}if(0===l)return 0;let f=0,g=0;for(let l=0;l<e.length;l++)if(!0===n[l]){let r=f;for(;r<t.length;r++)if(!0===h[r]){f=r+1;break}e[l]!==t[r]&&++g}let i=(l/e.length+l/t.length+(l-g/2)/l)/3,o=0;if(i>.7){for(;e[o]===t[o]&&o<4;)++o;i+=.1*o*(1-i)}return i}
